346321d3-b1a3-4ca0-b032-a788cc2114a1	Anxiety	The Anxiety Scale assesses the degree to which students worry about school and their academic performance. Students who score low on this scale are experiencing high levels of anxiety associated with school -note that this scale is reverse scored. High levels of anxiety can help direct attention away from completing academic tasks -sample item: When I am studying, worrying about doing poorly in a course interferes with my concentration. Students who score low on this scale may need to develop techniques for coping with anxiety and reducing worry so that attention can be focused on the task at hand.	2012-10-01 00:00:00	2012-10-01 00:00:00	58ba5ee3-734e-4ae9-b9c5-943774b4de41	58ba5ee3-734e-4ae9-b9c5-943774b4de41	1
349c6a52-2cd1-489c-b958-b6e5abdb02ff	Attitude	The Attitude Scale assesses students’ attitudes and interest in college and academic success. It examines how facilitative or debilitative their approach to college and academics is for helping them get their work done and succeeding in college -sample item: I have a positive attitude about attending my classes. Students who score low on this scale may not believe college is relevant or important to them and may need to develop a better understanding of how college and their academic performance relates to their future life goals.	2012-10-01 00:00:00	2012-10-01 00:00:00	58ba5ee3-734e-4ae9-b9c5-943774b4de41	58ba5ee3-734e-4ae9-b9c5-943774b4de41	1
683c6a7d-18bd-407d-8058-22be356cc079	Concentration	The Concentration Scale assesses students’ ability to direct and maintain attention on academic tasks -sample item: I find that during lectures I think of other things and don’t really listen to what is being said. Low scoring students may need to learn to monitor their level of concentration and develop techniques to redirect attention and eliminate interfering thoughts or feelings so that they can be more effective and efficient learners.	2012-10-01 00:00:00	2012-10-01 00:00:00	58ba5ee3-734e-4ae9-b9c5-943774b4de41	58ba5ee3-734e-4ae9-b9c5-943774b4de41	1
48e6c049-eae6-477c-b13f-4abb9f8d64b8	Information Processing	The Information Processing Scale assesses how well students’ can use imagery, verbal elaboration, organization strategies, and reasoning skills as learning strategies to help build bridges between what they already know and what they are trying to learn and remember, i.e., knowledge acquisition, retention and future application -sample item: I translate what I am studying into my own words. Students who score low on this scale may have difficulty making information meaningful and storing it in memory in a way that will help them recall it in the future.	2012-10-01 00:00:00	2012-10-01 00:00:00	58ba5ee3-734e-4ae9-b9c5-943774b4de41	58ba5ee3-734e-4ae9-b9c5-943774b4de41	1
927cf28c-89c1-4e05-b675-ee5e45047797	Motivation	The Motivation Scale assesses students’ diligence, self-discipline, and willingness to exert the effort necessary to successfully complete academic requirements -sample item: When work is difficult I either give up or study only the easy parts. Students who score low on this scale need to accept more responsibility for their academic outcomes and learn how to set and use goals to help accomplish specific tasks.	2012-10-01 00:00:00	2012-10-01 00:00:00	58ba5ee3-734e-4ae9-b9c5-943774b4de41	58ba5ee3-734e-4ae9-b9c5-943774b4de41	1
f2adf116-8e2d-4831-a315-0c8c8a404efa	Selecting Main Ideas	The Selecting Main Ideas Scale assesses students’ skill at identifying important information for further study from among less important information and supporting details -sample item: When studying, I seem to get lost in the details and miss the important information. Students who score low on this may need to develop their skill at separating out critical information on which to focus their attention. Tasks such as reading a textbook can be overwhelming if students focus on every detail presented.	2012-10-01 00:00:00	2012-10-01 00:00:00	58ba5ee3-734e-4ae9-b9c5-943774b4de41	58ba5ee3-734e-4ae9-b9c5-943774b4de41	1
1af31ae9-0832-496c-b3ed-d545d6bf9a89	Self-Testing	The Self-Testing Scale assesses students’ use of reviewing comprehension monitoring techniques to determine their level of understanding of the information to be learned -sample item: I stop periodically while reading and mentally go over or review what was said. Low scoring students may need to develop an appreciation for the importance of self-testing, and learn effective techniques for reviewing information and monitoring their level of understanding or ability to apply what they are learning.	2012-10-01 00:00:00	2012-10-01 00:00:00	58ba5ee3-734e-4ae9-b9c5-943774b4de41	58ba5ee3-734e-4ae9-b9c5-943774b4de41	1
816d8fc1-7e78-45c2-938b-eeb58a57066d	Study Aids	The Study Aids Scale assesses students’ use of supports or resources to help them learn or retain information -sample item: I use special study helps, such as italics and headings, that are in my textbooks. Students with low scores may need to develop a better understanding of the resources available to them and how to use these resources to help them be more effective and efficient learners.	2012-10-01 00:00:00	2012-10-01 00:00:00	58ba5ee3-734e-4ae9-b9c5-943774b4de41	58ba5ee3-734e-4ae9-b9c5-943774b4de41	1
969c0bc0-0395-402d-b03a-8dd226187349	Test Strategies	The Test Strategies Scale assesses students’ use of test preparation and test taking strategies -sample item: In taking tests, writing papers, etc., I find I have misunderstood what is wanted and lose points because of it. Low scoring students may need to learn more effective techniques for preparing for and taking tests so that they are able to effectively demonstrate their knowledge of the subject matter.	2012-10-01 00:00:00	2012-10-01 00:00:00	58ba5ee3-734e-4ae9-b9c5-943774b4de41	58ba5ee3-734e-4ae9-b9c5-943774b4de41	1
753ea301-aa13-4588-8c71-b7dc8bb26734	Time Management	The Time Management Scale assesses students’ application of time management principles to academic situations -sample item: I set aside more time to study the subjects that are difficult for me. Students who score low on this scale may need to develop effective scheduling and monitoring techniques in order to assure timely completion of academic tasks and to avoid procrastination while realistically including non-academic activities in their schedule.	2012-10-01 00:00:00	2012-10-01 00:00:00	58ba5ee3-734e-4ae9-b9c5-943774b4de41	58ba5ee3-734e-4ae9-b9c5-943774b4de41	1
\.
