9d3ce5b1-e27d-40c8-8f45-abcb1bccf3b0	New Student Intake Task Email	New Student Intake Task Email	Student Intake Form Request	<html><body><p>Hello ${fullName}!</p><p>Your Coach or Advisor has asked that you complete a Task online, the Student Intake form.  ${description}  The form is a series of questions that should only take a few minutes to complete.  The information collected will assist us in providing you with the best services and advice that we can.</p> <p>Please login with your college username and password at the following URL:  <a href="https://www.studentsuccessplan.org">https://www.studentsuccessplan.org</a></p><p>The Student Intake link will appear in the Task list on the right side of the screen.</p><p>Please complete this task by ${dueDateFormatted}</p><p>Thank you for your time and cooperation.  We look forward to providing you great service!</p><p>-College Team</p><p>If you have questions, please contact your Coach or Advisor directly. This is an automated message, please do not use the reply option.</p></body></html>	2012-05-17 10:00:00	2012-05-17 10:00:00	58ba5ee3-734e-4ae9-b9c5-943774b4de41	58ba5ee3-734e-4ae9-b9c5-943774b4de41	1
b528c1ac-6104-435b-ae62-09eb5f8ef55f	Early Alert Confirmation to Faculty	Message sent from system to faculty member when faculty member sends an alert.	Student$!termToRepresentEarlyAlert Confirmation Notice - $earlyAlert.person.firstName $earlyAlert.person.lastName #if( $earlyAlert.courseName) : $earlyAlert.courseName#end	<html><body>\n<p><b>STUDENT $!termToRepresentEarlyAlert SYSTEM MESSAGE</b></p>\n<table>\n<tr><th>Student Name</th><td>$earlyAlert.person.firstName $earlyAlert.person.lastName</td></tr>\n<tr><th>Student ID</th><td>$!earlyAlert.person.schoolId</td></tr>\n<tr><th>Student Phone</th><td>$!earlyAlert.person.homePhone</td></tr>\n<tr><th>Student Email</th><td>$earlyAlert.person.primaryEmailAddress</td></tr>\n<tr><th>Address</th><td>#if( $earlyAlert.person.addressLine1 )$earlyAlert.person.addressLine1, #end#if( $earlyAlert.person.addressLine2 )$earlyAlert.person.addressLine2, #end#if( $earlyAlert.person.city )$earlyAlert.person.city, #end#if( $earlyAlert.person.state )$earlyAlert.person.state, #end$!earlyAlert.person.zipCode</td></tr>\n<tr><th>In the class</th><td>$!earlyAlert.courseName</td></tr>\n<tr><th>Instructor</th><td>$earlyAlert.createdBy.firstName $earlyAlert.createdBy.lastName</td></tr>\n<tr><th>Campus</th><td>$!earlyAlert.campus.name</td></tr>\n<tr><th>Instructor Office Location</th><td>$!earlyAlert.createdBy.staffDetails.officeLocation</td></tr>\n<tr><th>Instructor Email</th><td>$earlyAlert.createdBy.primaryEmailAddress</td></tr>\n<tr><th>Instructor Phone</th><td>$!earlyAlert.createdBy.workPhone</td></tr>\n<tr><th>Advisor</th><td>$earlyAlert.person.coach.firstName $earlyAlert.person.coach.lastName</td></tr>\n</table>\n<p>Student has been identified by his/her instructor for the following reason:</ul>\n\n<ul>\n#foreach( $earlyAlertReason in $earlyAlert.earlyAlertReasonIds )\n<li>$earlyAlertReason.name</li>\n#end\n</ul>\n\n<p><b>The faculty suggestions are</b></p>\n<ul>\n#foreach( $earlyAlertSuggestion in $earlyAlert.earlyAlertSuggestionIds )\n<li>$earlyAlertSuggestion.name</li>\n#end\n</ul>\n\n#if( $earlyAlert.comment )\n<p>\n******************* INSTRUCTOR COMMENTS *******************\n<br />\n$earlyAlert.comment\n<br />\n******************* INSTRUCTOR COMMENTS *******************\n</p>\n#end\n\n\n<p>Email generated by $!institutionName $!applicationTitle $!termToRepresentEarlyAlert</p>\n\n<p>This is a system generated email. Please do not reply to this confirmation.</p>\n</body></html>	2012-05-18 16:00:00	2012-05-22 16:00:00	58ba5ee3-734e-4ae9-b9c5-943774b4de41	58ba5ee3-734e-4ae9-b9c5-943774b4de41	1
df47a4b0-b666-11e2-9e96-0800200c9a66	Map Plan Full Printout	Map Plan FULL Printout	Here is your MAP Plan	<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.01 Transitional//EN" "http://www.w3.org/TR/html4/loose.dtd">\n<html>\n<head>\n<style>\n@media print\n{\n  table { page-break-after:auto }\n  tr    { page-break-inside:avoid; page-break-after:auto; page-break-before:auto }\n  td    { page-break-inside:avoid; page-break-after:auto; page-break-before:auto }\n  thead { display:table-header-group }\n  tfoot { display:table-footer-group }\n}\n</style>\n<meta http-equiv="Content-Type" content="text/html; charset=iso-8859-1">\n<title>$title</title>\n</head>\n\n<body style="font-family: Tahoma; font-size: 12px;">\n<div>\n<div style="width: 980px; height: 120px;">\n\t<span style="float: left;"><img src="$!baseUrl/ssp/images/institution.gif" width="113" height="119" alt="$institution" border="0"></span>\n\t<span style="float: left; padding: 6px 0px 0px 12px; font-family: Tahoma; font-size: 22px;">$institution<br>Address<br>City, State 55555<br>1.480.558.2400</span>\n\t<span style="float: right; padding: 6px 12px 0px 0px; font-family: Tahoma; font-size: 18px;">$createdDateFormatted<br><br>$studentFullName<br>$studentEmail<br>School Id: $studentSchoolId<br></span>\n</div>\n #if($includeHeaderFooter)\n<div style="width: 980px; font-family: Tahoma; font-size: 14px;">\n\n\t<div style="padding: 6px 12px 0px 12px;">Below you will see the Academic Plan (MAP) that you have developed in cooperation with an Academic/Faculty Advisor. Please contact your\n\tAcademic/Faculty Advisor or Counselor if you have any questions or need to make modifications to MAP.</div>\n\t<div style="padding: 6px 12px 0px 12px;"><strong>Please Note:</strong> Information from the department(s) regarding planned course offerings was used by the advisor to recommend your courses. Courses\n\trecommended on your MAP may not be available as planned or at the times, locations, and/or delivery methods you prefer.\n\tCourses recommended on your MAP do not secure an open spot in a course or section that you desire; therefore, you are encouraged to register early.</div>\n</div>\n#end\n</div>\n<div style="position:relative;left:10px;top:20px;width: 980px">\n\t#foreach($termCourse in $termCourses) \n\t\t<table cellpadding="0" cellspacing="0" style="table-layout: fixed;margin-top:15px;background-color:white;width:100%;border:1px solid #ABABAB">\n\t\t\t<tr>\n\t\t\t\t<td style="font-size:small;text-align:left;padding-left:5px;color:#ABABAB"><strong>$termCourse.term.name</strong></td>\n\t\t\t\t<td style="font-size:small;text-align:right;padding-right:5px;color:#ABABAB"><strong>Term Cr. Hrs: $termCourse.totalCreditHours</strong> </td>\n\t\t\t</tr>\n\t\t\t\n\t\t\t#foreach($course in $termCourse.courses)\n\t\t\t\t#set ($odd = $foreach.count % 2)\n\t\t\t\t#if( $odd > 0 )\n\t\t       \t\t<tr>\n\t\t    \t#end\n\t\t\t\n\t\t\t\t<td valign="top" style="width:50%;word-wrap:break-word;text-align:left;padding-bottom:5px; padding-top:5px;padding-left:10px; padding-right:5px">\n\t\t\t\t\t<strong>$course.formattedCourse - $course.courseTitle $course.creditHours Cr. Hrs.</strong><br>\n\t\t\t\t\t#if("$!course.planToOffer" != "")PLAN TO OFFER: $course.planToOffer #end #if($includeCourseDescription)$!course.courseDescription #end\n\t\t\t\t\t\n\t\t\t\t\t#if("$!course.contactNotes" != "" || "$!course.studentNotes" != "")\n\t\t\t\t\t\t<p style="font-size:10px; margin-top:5px">\n\t\t\t\t\t\t#if(!$isPrivate && "$!course.contactNotes" != "")\n\t\t\t\t\t\t\t<span style="color:#ABABAB"><strong>Advisor Notes:</strong></span> $course.contactNotes\n\t\t\t\t\t\t#end\n\t\t\t\t\t\t#if(!$isPrivate && "$!course.contactNotes" != "" && "$!course.studentNotes" != "")\n\t\t\t\t\t\t<br/><br/>\n\t\t\t\t\t\t#end\n\t\t\t\t\t\t#if("$!course.studentNotes" != "")\n\t\t\t\t\t\t\t<span style="color:#ABABAB"><strong>Student Notes:</strong></span> $course.studentNotes\n\t\t\t\t\t\t#end\n\t\t\t\t\t#end\n\t\t\t\t</td>\n\t\t\t\t\t\n\t\t\t\t#if( $odd == 0 || $foreach.last)\n\t\t\t       <tr>\n\t\t\t\t#end\n\t\t\t#end\n\t\t\t#if($includeTotalTimeExpected)\n\t\t\t<tr>\n\t\t\t<td colspan="2" style="height:15px;border-top:1px solid #ABABAB;padding-left:10px">\n\t\t\t\t#set( $timeExpected = $termCourse.totalCreditHours * 2 )\n\t\t\tTime expected outside Class: $timeExpected (hours/week)\n\t\t\t</td>\n\t\t\t</tr>\n\t\t\t#end\n\t\t\t#if("$!termCourse.contactNotes" != "" || "$!termCourse.studentNotes" != "")\n\t\t\t<tr>\n\t\t\t\t<td colspan="2" style="padding-top: 5px; padding-bottom: 5px; padding-left:10px; padding-right:10px;border-top:1px solid #ABABAB;">\n\t\t\t\t\t#if(!$isPrivate && "$termCourse.contactNotes" != "")\n\t\t\t\t\t<span style="color:#ABABAB"><strong>Advisor Notes:</strong></span> $termCourse.contactNotes\n\t\t\t\t\t#end\n\t\t\t\t\t#if(!$isPrivate && "$termCourse.contactNotes" != "" && "$termCourse.studentNotes" != "")\n\t\t\t\t\t<br/><br/>\n\t\t\t\t\t#end\n\t\t\t\t\t#if("$termCourse.studentNotes" != "")\n\t\t\t\t\t<span style="color:#ABABAB"><strong>Student Notes:</strong></span> $termCourse.studentNotes\n\t\t\t\t\t#end\n\t\t\t\t</td>\n\t\t\t</tr>\n\t\t\t#end\n\t\t</table>\n\t#end\n</div>\n\t<div style="width: 980px">\n\t\t<div style="left:10px;margin-top:30px">\n\t\t<p style="text-align:center; color:#ABABAB;">\n\t\t<strong>Total MAP Credit HRS: TERM:</strong> $totalPlanHours <strong>DEV:</strong> $totalPlanDevHours\n\t\t</p>\n\t\t</div>\n\t#if($includeHeaderFooter)\n\t<div style="width: 980px">\n\t\t<div style="left:10px;margin-top:30px">\n\t\t<p style="text-align:left; color:#000000;">\n\t\t<strong>Attempted Hours - </strong> $!attemptedHours\n\t\t</p>\n\t\t<p style="text-align:left; color:#000000;">\n\t\t<strong>Completed Hours - </strong> $!completedHours\n\t\t</p>\n\t\t<p style="text-align:left; color:#000000;">\n\t\t<strong>Current Completion Rate - </strong> $!completionRage\n\t\t</p>\n\t\t<p style="text-align:left; color:#000000;text-indent:15px;">\n\t\t<strong>Number of hours needed to earn 67% completion rate - </strong> $!neededFor67PercentCompletion\n\t\t</p>\n\t\t<p style="text-align:left; color:#000000;">\n\t\t<strong>Financial Aid Cum GPA - </strong> $!financialAidGpa\n\t\t</p>\n\t\t<p style="text-align:left; color:#000000;text-indent:15px;">\n\t\t<strong>Number of needed to earn a 2.0 Cum GPA with all B - </strong> $!hoursNeededB\n\t\t</p>\n\t</div>\n\t#end\n\t#if("$!planContactNotes" != "" || "$!planStudentNotes" != "")\n\t\t<p style="padding-left:20px;margin-top:15px">\n\t\t#if(!$isPrivate && "$!planContactNotes" != "")\n\t\t\t<span style="color:#ABABAB"><strong>Advisor Notes:</strong></span>&nbsp;&nbsp;&nbsp;$!planContactNotes\n\t\t#end\n\t\t#if(!$isPrivate && "$!planContactNotes" != "" && "$!planStudentNotes" != "")\n\t\t<br/><br/>\n\t\t#end\n\t\t#if("$!planStudentNotes" != "")\n\t\t\t<span style="color:#ABABAB"><strong>Student notes:</strong></span>&nbsp;&nbsp;&nbsp;&nbsp;$!planStudentNotes\n\t\t#end\n\t\t</p>\n\t#end\n\t<p style="padding-left:20px;font-size:small;margin-top:30px;">\n\t<strong>If I have questions or concerns about my plan I will contact:</strong>\n\t</p>\n\t<p style="padding-left:20px;padding-left:20px;font-size:small">\n\t\t<strong>\n\t#if("$!contactName" != "") $!contactTitle $contactName #else $coachFullName #end</br>\n\t#if("$!contactPhone" != "") $contactPhone #else $coachPhone2 #end</br>\n\t#if("$!contactEmail" != "") $contactEmail #else $coachEmail #end\n\t</strong>\n\t</p>\n\t #if($includeHeaderFooter)\n\t<p style="padding-left:20px;font-size:small">\n\tI realize that agreeing to this plan and reaching my educational goals is my choice, and I understand that deviation from this plan may have negative academic\n\tor financial impacts on me as a student reaching my stated goals. I will contact my Academic Advisor or Counselor if I have any questions or need to make\n\tmodifications to my Academic Plan.\n\t</p>\n\t<div style="padding: 106px 12px 0px 12px;">\n\t\t<span style="border-top: 1px solid; width: 350px; float: left;">Student Signature</span>\n\t\t<span style="width: 90px; font-family: Tahoma; font-size: 14px; float: left;">&nbsp;</span>\n\t\t<span style="border-top: 1px solid; width: 350px; float: left;">Advisor/Counselor Signature</span>\n\t</div>\n\t#end\n\t</div>\n</body></html>	2013-04-23 10:00:00	2013-04-26 00:00:00	58ba5ee3-734e-4ae9-b9c5-943774b4de41	58ba5ee3-734e-4ae9-b9c5-943774b4de41	1
b528c1ac-6104-435b-ae62-08eb4f7ee2f9	Early Alert Journal Entry		Student $termToRepresentEarlyAlert Journal Entry - $earlyAlert.person.firstName $earlyAlert.person.lastName #if( $earlyAlert.courseName) : $earlyAlert.courseName#end	Summary:\nEarly Alert Course: $earlyAlert.courseName\nEarly Alert Created Date: $earlyAlert.createdDate\n\nResponse Created by: $earlyAlertResponse.createdBy.firstName $earlyAlertResponse.createdBy.lastName\nResponse Details:\nOutcome: $!earlyAlertResponse.earlyAlertOutcome.name\n#foreach( $earlyAlertOutreach in $earlyAlertResponse.earlyAlertOutreachIds )\nOutreach: $earlyAlertOutreach.name\n#end\n#foreach( $earlyAlertReferral in $earlyAlertResponse.earlyAlertReferralIds )\nReferral: $earlyAlertReferral.name\n#end\nComment: $earlyAlertResponse.comment\n	2012-05-17 10:00:00	2013-03-22 00:00:00	58ba5ee3-734e-4ae9-b9c5-943774b4de41	58ba5ee3-734e-4ae9-b9c5-943774b4de41	1
