5b7bdb2a-e7fe-e555-7599-02c9e3cacfa5	A Quick-Start Guide to College	A guide for new students immediately after Application.	2012-04-23 00:00:00	2013-09-03 12:40:23.914	58ba5ee3-734e-4ae9-b9c5-943774b4de41	58ba5ee3-734e-4ae9-b9c5-943774b4de41	1	0	Welcome to the Quick Start to College self-help guide.  Aided by MyGPS, you will navigate your pathway to a successful start at College.  On the following screens, you will be asked a series of questions concerning typical roadblocks faced by many students.  After submitting your answers, resources will be presented as possible solutions.  You will then have an opportunity to select resources that create your Personal Road Map.	Thanks for completing the Quick Start Guide! 			f
